import React from 'react';
import axios from 'axios';
import ReactTable from "react-table";

class UserPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {userName:props.userName,password:props.password};
    this.data = props.data;
  }
  renderTableData() {
      return this.data.map((book, index) => {
         const { id,userName, bookName, author,printDate } = book; //destructuring
         return (
            <tr key={id}>
               <td>{userName}</td>
               <td>{bookName}</td>
               <td>{author}</td>
               <td>{printDate}</td>
            </tr>
         )
      })
   }
  render(){
    return(
      <div>
      <table id='students'>
      <tbody>
      {this.renderTableData()}
      </tbody>
      </table>
      </div>
    );
  }
}
export default UserPage;
